import { useState } from 'react'
import Header from './components/Header'
import Tasks from './components/Tasks'

const App = () =>{
    const [tasks, setTasks] = useState ([
        {
            id: 1,
            text: 'Maintenance type 1',
            day: 'today',
            reminder: true,
        },
        {
            id: 2,
            text: 'Maintenance type 2',
            day: 'today',
            reminder: true,
        },
        {
            id: 3,
            text: 'Maintenance type 3',
            day: 'today',
            reminder: true,
        },
    ])

  return (
    <div className='container'>
      <Header/>
      <Tasks tasks={tasks}/>
    </div>
  );
}

export default App;
